import React from "react";

const NotFound = () => {
  return (
    <>
      <h1
        style={{
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          height: "100vh",
          fontSize: 50,
          color: "white"
        }}
      >
        Page Not Found
      </h1>
      <p
        style={{
          fontSize: 50,
          color: "white",
          backgroundColor: "red"
        }}
      >
        Sorry, this page does not exist
      </p>
    </>
  );
};

export default NotFound;
